import './App.css';

import React, { useState } from 'react';

const wishes = [
    "–î–∞ –±—ä–¥–µ—à –∑–¥—Ä–∞–≤ –∏ —â–∞—Å—Ç–ª–∏–≤ –≤—Å–µ–∫–∏ –¥–µ–Ω –Ω–∞ –∂–∏–≤–æ—Ç–∞ —Å–∏!",
    "–ù–µ–∫–∞ –≤—Å—è–∫–æ —É—Ç—Ä–æ —Ç–∏ –¥–æ–Ω–µ—Å–µ —É—Å–º–∏–≤–∫–∞ –∏ —Ä–∞–¥–æ—Å—Ç.",
    "–ñ–∏–≤–æ—Ç—ä—Ç –¥–∞ —Ç–∏ –µ –ø—ä–ª–µ–Ω —Å—ä—Å —Å–º–µ—Ö, –æ–±–∏—á –∏ —É—Å–ø–µ—Ö–∏.",
    "–î–∞ –æ—Ç–∫—Ä–∏–µ—à –∫—Ä–∞—Å–æ—Ç–∞—Ç–∞ –≤—ä–≤ –≤—Å–µ–∫–∏ –µ–¥–∏–Ω –¥–µ–Ω.",
    "–ó–¥—Ä–∞–≤–µ, –ª—é–±–æ–≤ –∏ —Å–ø–æ–∫–æ–π—Å—Ç–≤–∏–µ ‚Äì –æ—Å–Ω–æ–≤–Ω–∏—è—Ç —Ç—Ä–∏–µ–¥–∏–Ω –Ω–∞ —â–∞—Å—Ç–ª–∏–≤ –∂–∏–≤–æ—Ç.",
    "–ù–µ–∫–∞ –≤—Å—è–∫–∞ —Ç–≤–æ—è —Å—Ç—ä–ø–∫–∞ –±—ä–¥–µ —Å—Ç—ä–ø–∫–∞ –∫—ä–º –ø–æ—Å—Ç–∏–∂–µ–Ω–∏—è –∏ —É–¥–æ–≤–ª–µ—Ç–≤–æ—Ä–µ–Ω–∏–µ.",
    "–î–∞ —Ç–µ –∑–∞–æ–±–∏–∫–æ–ª–∏ –ø–æ–ª–æ–∂–∏—Ç–µ–ª–Ω–∞—Ç–∞ –µ–Ω–µ—Ä–≥–∏—è –∏ –±–ª–∞–≥–æ–ø–æ–ª—É—á–∏–µ.",
    "–ë—ä–¥–∏ –∫–∞—Ç–æ –ø—Ç–∏—Ü–∞ ‚Äì –ª–µ–∫–∞, —Å–≤–æ–±–æ–¥–Ω–∞ –∏ –ø—ä–ª–Ω–∞ —Å —Ä–∞–¥–æ—Å—Ç.",
    "–°–≤–µ—Ç–ª–∏–Ω–∞ –∏ —É—Å–ø–µ—Ö–∏ –≤ —Ç–≤–æ—è –∂–∏—Ç–µ–π—Å–∫–∏ –ø—ä—Ç!",
    "–î–∞ –æ—Ç–∫—Ä–∏–µ—à —Ä–∞–¥–æ—Å—Ç—Ç–∞ –≤ –º–∞–ª–∫–∏—Ç–µ –Ω–µ—â–∞ –∏ –≤–Ω–∏–º–∞–Ω–∏–µ –≤ –≥–æ–ª–µ–º–∏—Ç–µ."
];

function MyComponent() {
    const [randomWish, setRandomWish] = useState('');
    const [rating, setRating] = useState('');
    const [reviewText, setReviewText] = useState('');

    const generateWish = () => {
        const randomIndex = Math.floor(Math.random() * wishes.length);
        setRandomWish(wishes[randomIndex]);
    };
  };
    const shareOnSocialMedia = (socialMedia) => {
        const url = `https://cherrybymary.com/en?fortune=${encodeURIComponent(randomWish)}`;
        let shareUrl = '';

        switch (socialMedia) {
            case 'facebook':
                shareUrl = `https://www.facebook.com/sharer/sharer.php?u=${encodeURIComponent(url)}`;
                break;
            case 'instagram':
                shareUrl = `https://www.instagram.com/sharer.php?u=${encodeURIComponent(url)}`;
                break;
            case 'twitter':
                shareUrl = `https://twitter.com/intent/tweet?url=${encodeURIComponent(url)}&text=Check%20out%20this%20fortune:%20${encodeURIComponent(randomWish)}`;
                break;
            default:
                break;
        }

        window.open(shareUrl, '_blank');
    };







function App() {
  return (
    <div className="App">

        <h1>üåü –∫—ä—Å–º–µ—Ç—á–µ —Å –∫–∞—Ñ–µ—Ç–æ üåü</h1>
        <p id="fortune-display">–ò —Ç–≤–æ—è—Ç –∫—ä—Å–º–µ—Ç –µ....</p>


        <button onClick={generateWish}>—Ü—ä–∫–Ω–∏ –∑–∞ –¥–∞ —Ä–∞–∑–±–µ—Ä–µ—à </button>


        <div id="social-sharing-buttons">
            <a href="#" onclick="shareOnFacebook()">

          </a>
            <a href="#" onclick="shareOnTwitter()">

            </a>
            <a href="#" onclick="shareOnInstagram()">

            </a>
        </div>

        <form id="google-review-form">
                    <label for="review-rating">Rating:</label>
                    <div class="star-rating" id="review-rating" onclick="handleStarRating(event)">
                        <span class="star" data-value="1">‚òÖ</span>
                        <span class="star" data-value="2">‚òÖ</span>
                        <span class="star" data-value="3">‚òÖ</span>
                        <span class="star" data-value="4">‚òÖ</span>
                        <span class="star" data-value="5">‚òÖ</span>
                    </div>

                    <label for="review-text">Review:</label>
                    <textarea id="review-text" name="review-text" rows="4" required></textarea>

                    <button type="submit" onclick="submitGoogleReview()">Submit Review</button>
                </form>

    </div>
  );
}

export default App;
